import React from "react";

const Posts = (props) => {
    const {posts} = props

    return (
        posts.map(post => {
            return <div key={post.id}>
                    <h2></h2>
                    <p>Location: {post.location}</p>
                   </div>
        })
    )
}

export default Posts;
